import React from "react";
import '../MenuProfesor.css'

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends React.Component {
  constructor(props){
    super(props);
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick(){
  }

  render(){
  return (
    <div className="App">
      <header className="App-header">
        <h1>Sistema de Registro de Protocolos </h1>
      </header>
      <div className="bienvenida">
        <h1>Bienvenido, Profesor(a)</h1>
      </div>
      <Router>
      <div className='container'>
        <button>
          <Link to="/ttasignado">Trabajos Terminales asignados</Link>
        </button>
        <div classname="separador"></div>
      </div>
      <Switch>
      <Route path="/ttasignado">
        <TTasignado/>
      </Route>
    </Switch>
      </Router>
      
    </div>
  );
  }
}

function TTasignado() {
  return (
    <div className="datosTT">
    <h1>Protocolos asignados</h1>
    <table className="tabla">
    <tr>
      <td>Nombre del TT:</td>
      <td>Aquí va el nombre del TT</td>
    </tr>
    <tr>
      <td>Alumno a cargo:</td>
      <td>Aquí va el nombre del alumno</td>
    </tr>
    <tr>
      <td>Link a protocolo:</td>
      <td>Aquí va el link</td>
    </tr>
    <tr>
      <td>Subir evaluación:</td>
      <td>Aquí va la evaluación</td>
    </tr>
    <tr>
      <td>Observaciones:</td>
      <td>                                                                                                                             Aquí van las observaciones</td>
    </tr>
    </table>
    </div>
  );
}

export default App;
